// External libraries
import { ThreeDots } from 'react-loader-spinner';

const Loader = () => {
    return (
        <div style={{
            height: '70vh',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
        }}>
            <ThreeDots
                height="80"
                width="80"
                radius="9"
                color="#3498db"
                ariaLabel="loading"
                visible={true}
            />
        </div>
    );
};

export default Loader;
